import React from 'react';
import './App.css';
import { useNavigate } from 'react-router-dom'; // Uvoz useNavigate hooka

function App() {
  // Hook useNavigate će se koristiti za programsku navigaciju
  const navigate = useNavigate();

  // Modificirana Button komponenta da prima onClick funkciju kao prop
  function Button({ text, onClick }) {
    return (
      <div className="Button" onClick={onClick}>
        {text}
      </div>
    );
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1>Aplikacija za lov</h1>
        <div className="Menu">
          <Button text="EVIDENCIJA LOVACA" />
          <Button text="RASPORED AKTIVNOSTI I LOVA" />
          <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" />
          <Button text="UNOS DIVLJAČI" />
          <Button text="UNOS ODSTRIJELENE DIVLJAČI" />
          {/* Modifikacija gumba "BODOVI" za preusmjeravanje */}
          <Button text="BODOVI" onClick={() => navigate('/popis-bodova')} />
        </div>
      </header>
    </div>
  );
}

export default App;
